import itertools


class Solution:
    def twoSum(self, nums, target):
        """
        :type nums: List[int]
        :type target: int
        :rtype: List[int]
        """
        dicts = {}
        for x,num in enumerate(nums):
            if target-nums[x] in dicts:
                return [dicts[target-num]+1,x+1]
            dicts[num]=x
            #print(dicts)
        
    

                    
         
